import { GET_LOGIN_REQUESTED,GET_DATA_REQUESTED } from "../constants"
export const getdata = (data) =>{
    return({
        type:GET_LOGIN_REQUESTED,
        payload:data
    })
}

export const showdata = () =>{
    return({
        type:GET_DATA_REQUESTED
    })
}

export const adddata = () =>{
    return({
        type:GET_SHOW_POST_REQUESTEDED
    })
}
